import styles from './styles.module.scss';

function ProjectImage({
    imgUrl,
    side
}) {
    let useClass;
    if (side = 'left') {
        useClass = styles.left;
    }
    if (side = 'right') {
        useClass = styles.right;
    }
    return(
        <div className={useClass}>
            <img className={styles.img_project} src={imgUrl} alt=''/>
        </div>
    )
}

export default ProjectImage;
